import React from 'react'
import myPDF from './assets/Rushikesh-Amrut-Chape-FlowCV-Resume-20240306.pdf';
import './css/pdf.css'
const downloadPDF = () => {
    const download= ()=>{
        window.open(myPDF);
    }
  return (
    <>
    <div className="pdfmain">
    <h1>Download <span className="highlight">Resume</span></h1>
        <button onClick={download}>Download PDF</button>
        <h1>Github <span className="highlight">Profile</span></h1>
        <a className="githublink" href="https://github.com/rushikeshchape"><button>Visit</button></a>
  
    </div>
    </>
  )
}
export default downloadPDF;
